import PropTypes from 'prop-types'

function Key(props) {

    return (
         <li className="key" key={props.keyValue} >{props.keyValue}</li>
    )
}

Key.propTypes = {

    keyValue: PropTypes.string.isRequired,
    onClick: PropTypes.func.isRequired
}

export default Key

